import React, {useEffect,useState}from 'react';
import axios from 'axios';
import Swal from 'sweetalert2';
import withReactContent from 'sweetalert2-react-content';
import { show_Alerta } from '../Functions';
const ShowUsers = () => {
    let url='//localhost:8094/api/usuarios/list';    
    let [usuarios,setUsuarios]=useState([]);
    let [id,setId]=useState('');
    let [numerodocumento,setNumerodocumento]=useState('');
    let [email,setEmail]=useState('');
    let [nombre,setNombre]=useState('');
    let [password,setPassword]=useState('');
    let [nombreusuario,setNombreusuario]=useState('');
    let [operation,setOperation]=useState(1);
    let [title,setTitle]=useState('');
    useEffect(()=>{
      getUsers();
    },[]);

    const getUsers=async () =>{
      let respuesta=await axios.get(url);
      setUsuarios(respuesta.data);
    }

    
    return (
      <div className='App'>
        <div className='container-fluid'>
          <div className='row mt-3'> 
            <div className='col-md-4 offset-md-4'>
              <div className='d-grid mx-auto'>
                <button className='btn btn-dark' data-bs-toggle='modal' data-bs-target='#modalUsuarios'>
                  <i className='fa-solid fa-circle-plus'></i> AÃ±adir
                </button>
              </div>

            </div>
          </div>
          <div className='row mt-3'>
            <div className='col-12 col-lg-8 offset-0 offset-lg-2'>
              <div className='table-responsive'>
                <table className='table table-bordered'>
                  <thead>
                    <tr><th>#</th><th>NOMBRE DE USUARIO</th><th>NUMERO DE DOCUMENTO</th><th>EMAIL</th><th>NOMBRE</th><th>PASSWORD</th></tr>

                  </thead>
                  <tbody className='table-group-divider'>
                    {usuarios.map((usuario,i)=>(
                      <tr key={usuario.id}>
                        <td>{(i+1)}</td>
                        <td>{usuario.nombreusuario}</td>
                        <td>{usuario.numerodocumento}</td>
                        <td>{usuario.email}</td>
                        <td>{usuario.nombre}</td>
                        <td>{usuario.password}</td>
                        <td>
                          <button className='btn btn-warning'>
                            <i className='fa-solid fa-edit'></i>
                          </button>
                          &nbsp;
                          <button className='btn btn-danger'>
                            <i className='fa-solid fa-trash'></i>

                          </button>
                        </td>
                      </tr>
                    ))}

                  </tbody>
                </table>

              </div>

            </div>

          </div>
        </div>
        <div className='modal fade'>
          
        </div>
      </div>
  )
}

export default ShowUsers
